$(function(){

  $(window).on('scroll',function(){

    var scrollValue=$(window).scrollTop();

    if(scrollValue >=600){
      $('.nb221-title-pic-fixed').addClass('display');
    }

    if(scrollValue<600){
      $('.nb221-title-pic-fixed').removeClass('display');
    }

  });

});
